import ArticlesItem from "./Items/ArticlesItem";

const Articles = (props) => {
  return (
    <div>
      {props.data.map((el) => {
        return (
          <div>
            <ArticlesItem
              key={props.index}
              data={props.data}
              index={props.index}
                />
                <button>1231234</button>
          </div>
        );
      })}
    </div>
  );
};

export default Articles;
